function MainMenu({ onStartGame, onOpenSettings }) {
    return (
      <div className="main-menu">
        <h1 className="game-title">Mi Juego</h1>
        <div className="menu-buttons">
          <button className="menu-button" onClick={onStartGame}>Jugar</button>
          <button className="menu-button" onClick={onOpenSettings}>Ajustes</button>
        </div>
      </div>
    );
  }
  
  export default MainMenu;
